import * as React from "react";
import Box from "@mui/material/Box";
import TextField from "@mui/material/TextField";
import Button from "@mui/material/Button";
import FormGroup from "@mui/material/FormGroup";
import FormControlLabel from "@mui/material/FormControlLabel";
import Checkbox from "@mui/material/Checkbox";
import MenuItem from "@mui/material/MenuItem";
import FormControl from "@mui/material/FormControl";
import Select from "@mui/material/Select";
import InputLabel from "@mui/material/InputLabel";

class Form extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      pageNumbers: 10,
      page: 1,
      form: { searchText: "", is2b2b: false, isSecure: false, age: "Ten" },
    };
  }

  handleChange = (event) => {
    this.setState({ form: { age: event.target.value } });
  };

  onTextFieldChange = (e) => {
    this.setState({ form: { ...this.state.form, searchText: e.target.value } });
  };

  submitClicked = () => {
    console.log("This Form :", this.state.form);
  };

  render() {
    const { is2b2b, isSecure, age } = this.state.form;
    return (
      <Box
        component="form"
        sx={{
          display: "flex",
          flexDirection: "row",
          justifyContent: "space-around",
          alignItems: "center",
        }}
        noValidate
        autoComplete="off"
      >
        <TextField
          onChange={(e) => {
            this.onTextFieldChange(e);
          }}
          value={this.state.form.searchText}
          id="outlined-basic"
          label="Search Here"
          variant="outlined"
        />
        <FormGroup>
          <FormControlLabel
            control={<Checkbox checked={is2b2b} />}
            label="2 Bedroom"
          />
          <FormControlLabel
            control={<Checkbox checked={isSecure} />}
            label="3 Bedroom"
          />
        </FormGroup>
        <FormGroup>
          <FormControlLabel
            control={<Checkbox checked={is2b2b} />}
            label="1 Bedroom"
          />
          <FormControlLabel
            control={<Checkbox checked={isSecure} />}
            label="secure"
          />
        </FormGroup>
        <FormGroup>
          <FormControlLabel
            control={<Checkbox checked={is2b2b} />}
            label="Good Reviews"
          />
          <FormControlLabel
            control={<Checkbox checked={isSecure} />}
            label="Spacious"
          />
        </FormGroup>
        <FormGroup>
          <FormControlLabel
            control={<Checkbox checked={is2b2b} />}
            label="Affordable"
          />
          <FormControlLabel
            control={<Checkbox checked={isSecure} />}
            label="secure"
          />
        </FormGroup>
        <FormGroup>
          <FormControlLabel
            control={<Checkbox checked={is2b2b} />}
            label="2b2b"
          />
          <FormControl sx={{ m: 1, minWidth: 120 }} size="small">
            <InputLabel id="demo-select-small">Age</InputLabel>

            <Select
              labelId="demo-select-small"
              id="demo-select-small"
              value={age}
              label="Age"
              onChange={(e) => this.handleChange(e)}
            >
              <MenuItem value="">
                <em>None</em>
              </MenuItem>
              <MenuItem value={10}>Ten</MenuItem>
              <MenuItem value={20}>Twenty</MenuItem>
              <MenuItem value={30}>Thirty</MenuItem>
            </Select>
          </FormControl>
        </FormGroup>
        <div>
          <Button onClick={() => this.submitClicked()} variant="contained">
            Search
          </Button>
        </div>
      </Box>
    );
  }
}

export default Form;
